import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <AppBar position="static" sx={{ backgroundColor: 'white', boxShadow: 'none', borderBottom: '1px solid #e0e0e0' }}>
      <Toolbar>
        <Box sx={{ flexGrow: 1 }}>
          <Typography variant="h6" sx={{ color: 'black' }}>
            EcosysTech
          </Typography>
        </Box>
        <Button component={Link} to="/dashboard" sx={{ color: 'black' }}>
          Home
        </Button>
        <Button sx={{ color: 'black' }}>Profile</Button>
        <Button component={Link} to="/signin" sx={{ color: 'black' }}>
          Log Out
        </Button>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
